import React from 'react';
import Menu from './Menu';
import Leftnavbar from './Leftnavbar';
import Bio from './Bio';
import { Route,Switch } from 'react-router-dom';



const App=()=>{
    return (
        <React.Fragment>
            <Menu />
            <Leftnavbar />
            <switch>
                <Route exact path="/" component={Bio} />
                <Route exact path="/Hom" component={Bio} />
                <Route exact path="/" component={Bio} />
                 
            </switch>
        </React.Fragment>

    );

};

export default App;
